/**
 * @Author   jiangqiang
 * @DateTime 2019-10-08
 * 生成随机颜色
 * @return   {[type]}   [description]
 */
function randomColor() {
    return (
        '#' +
        Math.random()
        .toString(16)
        .slice(-6)
    )
}

/**
 * @Author   jiangqiang
 * @DateTime 2019-09-02
 * 数组类型格式化Type
 * @param    {[array]}   list [数组]
 * @return   {[array]}        [数组]
 */
function formatDataType(list, dealSourcesData) {
    for (var i = 0; i < list.length; i++) {
        let arr = list[i]
        arr.data = arr.data.map(row => {
            row.date = formatDate(row.date)
            row.type = 'no'
            // 来源
            let sourcesData = JSON.parse(JSON.stringify(dealSourcesData))
            let sou = sourcesData.filter(item => {
                return item.name == row.source
            })
            if (sou && sou.length > 0) {
                row.type = sou[0].type
                row.icon = sou[0].icon
                row.color = sou[0].color
            } else {
                row.type = ''
                row.icon = ''
                row.color = ''
            }
            return row
        })
    }
    return list
}

/**
 * @Author   jiangqiang
 * @DateTime 2019-09-03
 * 数组分组
 * @param    {[array]}    list   [description]
 * @param    {[string]}   byName [分组字段]
 * @return   {[array]}           [description]
 */
function groupBy(list, byName) {
    let arr = list
    var map = {},
        dest = []
    for (var i = 0; i < arr.length; i++) {
        var ai = arr[i]
        if (!map[ai[byName]]) {
            dest.push({
                name: ai[byName],
                data: [ai]
            })
            map[ai[byName]] = ai
        } else {
            for (var j = 0; j < dest.length; j++) {
                var dj = dest[j]
                if (dj.name == ai[byName]) {
                    dj.data.push(ai)
                    break
                }
            }
        }
    }
    return dest
}

/**
 * @Author   jiangqiang
 * @DateTime 2019-09-11
 * 自定义分页
 * @param    {[type]}   list [数组]
 * @param    {[type]}   size [每页数量]
 * @return   {[type]}        [description]
 */
function pageList(list = [], size = 4) {
    var result = []
    for (var i = 0; i < list.length; i += size) {
        result.push(list.slice(i, i + size))
    }
    let param = {
        data: result,
        total: list.length,
        size: size,
        allData: list
    }
    return param
}

