/**
 * @Author   jiangqiang
 * @DateTime 2019-09-18
 * 格式化图标数据
 * @param    {[type]}   code [description]
 * @param    {[type]}   tags [description]
 * @param    {[type]}   sources [description]
 * @return   {[type]}        [description]
 */
function formatChartData(code, tags, sources) {
    let dealData = dealList(code, tags, sources)
    let formatData = formatListData(dealData.groupByList, dealData.values)
    let chartData = {
        legend: formatData.legend,
        arr: formatData.arr,
        unit: dealData.unit,
        sources: dealData.dealSourcesData
    }
    // console.log(chartData)
    return chartData
}

function formatListData(list, values) {
    //格式化数据
    // console.log(list)
    let arr = []
    let valNames = values
    for (let i = 0; i < list.length; i++) {
        let pa = {
            time: list[i].name,
            type: list[i].data[0].type,
            icon: list[i].data[0].icon,
            color: list[i].data[0].color,
            data: list[i].data
        }
        for (let j = 0; j < valNames.length; j++) {
            let keyName = 'seriesKeyName' + j

            let avgsList = list[i].data.filter(row => {
                let rowV = row.value[valNames[j]]
                return rowV && rowV.trim()
            }) //去除空值
            let avg = ''
            if (avgsList && avgsList.length > 0) {
                let vals = avgsList
                    .map(row => {
                        return parseFloat(row.value[valNames[j]])
                    })
                    .reduce(calc.Add)
                avg = calc.Div(vals, avgsList.length).toFixed(2) //计算平均值
            }
            pa[keyName] = avg
        }
        arr.push(pa)
    }
    let result = {
        legend: valNames,
        arr: arr
    }
    return result
}

